window.bookSummaryJSON = "<p><b>Fate kept bringing them together when the world fought to keep them apart.</b></p> <p><b>Danny Rider, Operator Grim Reaper</b></p> <p>I never thought I could change. My main purpose in life has always been my career and my team. That is until my tainted soul met the sweet and angelic Ari Alvarez... my dead best friend's sister.</p> <p>Her love has become my newest addiction. Just when things seemed to be okay again, there's an evil that lurks. A new threat I'm determined to protect us from.</p> <p><b>Ari Alvarez</b></p> <p>After meeting the sinfully handsome Navy SEAL, my life has changed... forever. After my brother's death, I felt like I needed to take control of my life, and it was a new era of drastic changes. That's when I met Operator Grim Reaper. My shell has been obliterated by him in all the best ways. Even though Danny makes me feel safe, I still catch myself looking over my shoulder.</p> <p>Will the constant darkness that's been inflicted upon them finally tear them apart?</p>"; 
